using namespace std; 

class Solution {
public:
    int shortestDistance(vector<vector<int>>& maze, vector<int>& start, vector<int>& destination) {
        // Dijkstra, DFS, heap 
		//for(int i=0; i<maze.size(); i++){for(int j=0; j<maze[0].size(); j++)	cout<<maze[i][j]<<" ";	cout<<endl;}
        int d, i, j, x, y;
        vector<pair<int,pair<int,int>>> hp;// distance, x, y cordinate 
        pushHp( hp, maze, make_pair( 0, make_pair(start[0],start[1])) );
        
        while(!hp.empty()){
            d=hp[0].first;
            i=hp[0].second.first;
            j=hp[0].second.second;
            maze[i][j]=-1;// record vistied here not when pushed into heap!!
            //cout<<i<<","<<j<<": "<<d<<endl;
            if(i==destination[0]&&j==destination[1])    return d;
            popHp(hp);
            
            for( x=i; 0<x&&maze[x-1][j]!=1; x--){}
            if(maze[x][j]==0)   pushHp(hp, maze, make_pair(d+i-x,make_pair(x,j)));
            
            for( x=i; x<maze.size()-1&&maze[x+1][j]!=1; x++){}
            if(maze[x][j]==0)   pushHp(hp, maze, make_pair(d+x-i,make_pair(x,j)));
            
            for( y=j; 0<y&&maze[i][y-1]!=1; y--){}
            if(maze[i][y]==0)   pushHp(hp, maze, make_pair(d+j-y,make_pair(i,y)));
            
            for( y=j; y<maze[0].size()-1&&maze[i][y+1]!=1; y++){}
            if(maze[i][y]==0)   pushHp(hp, maze, make_pair(d+y-j,make_pair(i,y)));
        }
        
        return -1;
    }
    
protected:    
    void pushHp(vector<pair<int,pair<int,int>>>& hp, vector<vector<int>>& maze, pair<int,pair<int,int>> pr){// min heap 
        int i=hp.size();
        hp.push_back(pr);
        
        while(0<i){
            if(hp[i].first<hp[(i-1)>>1].first){
                pr=hp[i];
                hp[i]=hp[(i-1)>>1];
                hp[(i-1)>>1]=pr;
                i=(i-1)>>1;
            }else{
                return ;
            }
        }
        return ;
    }
    
    void popHp(vector<pair<int,pair<int,int>>>& hp){// pop 1st element 
        int i=0;
        pair<int,pair<int,int>> pt;
        hp[0]=hp.back();
        hp.pop_back();
        while(2*i+2<hp.size()){
            if(hp[2*i+1].first<hp[i].first&&hp[2*i+1].first<hp[2*i+2].first){
                pt=hp[i];
                hp[i]=hp[2*i+1];
                hp[2*i+1]=pt;
                i=2*i+1;
            }else if(hp[2*i+2].first<hp[i].first){
                pt=hp[i];
                hp[i]=hp[2*i+2];
                hp[2*i+2]=pt;
                i=2*i+2;
            }else{
                return ;
            }
        }
        if(2*i+1<hp.size()&&hp[2*i+1].first<hp[i].first){
            pt=hp[i];
            hp[i]=hp[2*i+1];
            hp[2*i+1]=pt;            
        }
        return ;
    }
};

